import { Transform } from "./Transform"

export const Components = (props) => {
  return <div
    style={{
      margin: 12
    }}
  >
    <h2>GameObject</h2>
    <div
      onClick={() => {
        window.editor.setNameInput([props.name, (newText) => {
          if(Object.keys(props.object).includes(newText)) {
            return
          }

          props.object[newText] = {
            type: `gameObject`
          }

          window.editor.reloadHierarchy()
        }])
      }}
    >
      {props.name}
    </div>
    <Transform {...props} />
  </div>
}
